import React from "react";


import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Login from "./Containers/Login";


function App() {
  return (
    <>
      <Router>
        <Switch>
          <Route exact path="/" component={Login} />
          <Route path="/login" component={Login} />
          <Redirect to="/" />
        </Switch>
      </Router>
    </>
  );
}

export default App
